      <div style="float:left;color:#023c56;font-size:15px;margin-left:10px;padding-top:116px">
   "Creativity is more than just being different. Anybody can plan weird; that's easy. What's hard is to be as simple as Bach. Making the simple, awesomely simple, that's creativity"
       - Charles Mingus
<br><br>
I started my journey with IEEE-TSEC as a member due to which I went for the IV during my first year. The interaction with the committee then gave me a great amount of exposure to certain technical aspects of being a member of IEEE. I then actively participated as a volunteer in ISAAC 2013. The amount of fun and experience I had cannot be described in words. After that, I gave the interview and was selected as a creative team member in the junior committee. Today, here I am the creative head of IEEE-TSEC.
<br><br>
We, at IEEE-TSEC, aim to provide all the members with an excellent platform to exploit as many resources as possible and develop in terms of technical knowledge, professionalism and as an individual. I am very glad to be a part of IEEE-TSEC as I myself have learnt a lot from here.
<br><br>
I, being the creative head, will try my best to represent our committee in the most appropriate and creative way possible. Serving IEEE-TSEC has helped me develop my creative and technical skills and so now I am trying my best to teach others the same and help them inculcate the same enthusiasm.
      </div>
      <div style="float:left;bottom:0px;margin:8px;font-size:17px">
         <br>
        <b>Aditi Asthana<br>
Creative Head<br>
IEEE-TSEC</b>

